                    Math.ceil((dp[i - 1][j] + dist[i - 1] - 1) / speed) * speed
                );
            }
            if (j > 0) {
                dp[i][j] = Math.min(dp[i][j], dp[i - 1][j - 1] + dist[i - 1]);
            }
        }
    }
    for (let i = 0; i <= n; i++) {
        if (dp[n][i] <= hoursBefore * speed) {
            return i;
        }
    }
    return -1;
}
